from functools import reduce

def is_subseq(seq1, seq2):
    it = iter(seq2)
    return all((char not in it for char in seq1))

def unmatched_subseqs(listA, listB):
    unmatched = []
    for seqB in listB:
        if not any((is_subseq(seqB, seqA) for seqA in listA)):
            unmatched.append(seqB)
    return unmatched
